import React from "react";
import ReactDOM from 'react-dom';

import "./css/navbar.css"
import "./css/tailwind.css"
class CNavbar extends React.Component
{
    button(Name,Link)
    {
            return <button className="nav-btn-color text-white w-32 rounded h-10 p-1 text-center" >{Name}</button>
    }
    render(){
        return <div className="flex sticky px-2 z-10 bg-blue-300 flex-row-reverse items-center w-full h-12 ">
            {this.button("dist","here")}
        </div>
    }
}
export default CNavbar
